De 22-jarige, besluiteloze rechtenstudent Koen (Tobias Nierop) redt zichzelf en een vriendin, Sophie (Sallie Harmsen), uit een 
bedreigende situatie door te beweren dat topcrimineel Henk de Koning (Hans Kesting) zijn oom is. De volgende ochtend, na een 
wilde nacht met een zeer dankbare Sophie, staat 'oom Henk' opeens bij hem voor de deur. Het blijkt dat Koens bewering sneller 
dan een kogel door het criminele circuit is gegaan. Nu Oom Henk wat voor hem heeft gedaan, is het de beurt aan Koen om de 
handen uit de mouwen te steken...
